// SPDX-License-Identifier: MIT
// Beef Bank Contracts v0.0.0 hello@mcdu.com

pragma solidity ^0.8.0;
import "@openzeppelin/contracts/utils/introspection/IERC165.sol";
import "./IWallet.sol";
import "../contracts/agnostic/Token/TokenLib.sol";


interface IBank is IWallet {

    function currencyExists(bytes32 currency_) external view returns (bool);
    function currency(address token_, uint256 tokenId_) external returns (bytes32);
    function currencyView(address token_, uint256 tokenId_) external view returns (bytes32);
    function currencyPure(address token_, uint256 tokenId_) external pure returns (bytes32);
    function currencyResolve(bytes32 currency_) external view returns (address, uint256);
    function currencyResolveToken(bytes32 currency_) external view returns (address);


    function info(bytes32 currency_) external view returns (Token.Info memory);
    function features(bytes32 currency_) external view returns (uint64);
    function hasFeature(bytes32 currency_,uint64 feature_) external view returns (bool);
    function isFeatureType(bytes32 currency_,uint64 type_) external view returns (bool);
    function supportsInterface(bytes32 currency_,bytes4 interfaceId) external view returns (bool);
    function nft(bytes32 currency_) external view returns (bool);
    function granularity(bytes32 currency_) external view returns (uint256);
    function image(bytes32 currency_) external view returns (string memory);


    function modeTest() external view returns (bool);
    function allowCredit() external view returns (bool);

    function wallet(address account_) external view returns (IWallet);

    function account(address account_) external view returns (bytes32[] memory,Currency[] memory);

    function accountCurrencies(address account_) external view returns (bytes32[] memory);
    function accountCurrencyBatch(address account_,bytes32[] calldata currency_) external view returns (Currency[] memory);
    function accountCurrency(address account_,bytes32 currency_) external view returns (Currency memory);
}
